import React, { useRef } from 'react';
import './App.css';
import HomePage from './Pages/ HomePage';
import ContactButtonsComponent from './Components/ContactButtonsComponent';
import DescriptionPage from './Pages/DescriptionPage';
import ServicesPage from './Pages/ServicesPage';
import SkillPage from './Pages/SkillsPage';
import ProjectsPage from "./Pages/ProjectsPage"

function App() {
  const homeRef = useRef(null);
  const descriptionRef = useRef(null);
  const servicesRef = useRef(null);
  const contactRef = useRef(null);
  const skillsRef = useRef(null);
  const projectsRef = useRef(null);

  return (
    <div className="App">
      <div ref={homeRef}><HomePage /></div>
      <div ref={descriptionRef}><DescriptionPage /></div>
      <div ref={servicesRef}><ServicesPage /></div>
      <div ref={contactRef}><ContactButtonsComponent /></div>
      <div ref={skillsRef}><SkillPage /></div>
      <div ref={projectsRef}><ProjectsPage /></div>
    </div>
  );
}

export default App;
